module.exports = /*#__PURE__*/JSON.parse('{"archive":{"blogPosts":[{"id":"etn-ecosystem-launches-mesewer-books","metadata":{"permalink":"/blog/etn-ecosystem-launches-mesewer-books","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-06-01-mesewer-books-launch-announcement.md","source":"@site/blog/2025-06-01-mesewer-books-launch-announcement.md","title":"ETN Ecosystem Launches Mesewer Books: A Web3 Ebook Marketplace","description":"FOR IMMEDIATE RELEASE","date":"2025-06-16T10:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":3.46,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"etn-ecosystem-launches-mesewer-books","title":"ETN Ecosystem Launches Mesewer Books: A Web3 Ebook Marketplace","authors":["etn"],"tags":["etn"],"date":"2025-06-16T10:00:00.000Z"},"unlisted":false,"nextItem":{"title":"Upcoming Launch of Mesewer Books- A Web3 Ebook Marketplace by the ETN Ecosystem, Championing African Authors and Revolutionizing E-Commerce Access","permalink":"/blog/2025/06/01/mesewer-books-launch"}},"content":"**FOR IMMEDIATE RELEASE**\\n\\n**ETN Ecosystem Launches Mesewer Books: A Web3 Ebook Marketplace Championing African Authors and Revolutionizing E-Commerce Access**\\n\\n<!--truncate-->\\n\\nADDIS ABABA, ETHIOPIA  June 16, 2025  The ETN Ecosystem today announced the launch of Mesewer Books, a groundbreaking Web3 ebook marketplace developed by ET Netsa Apps. This new platform is set to empower authors, particularly within Africa, by offering an unprecedented 90% revenue share and leveraging the efficiency of blockchain technology for instant payouts, exclusively through its native ETN token.\\n\\nMesewer Books aims to dismantle the traditional barriers faced by African creators in the digital marketplace. Authors publishing on the platform will benefit from a transparent 10% commission structure, with immediate access to their earnings facilitated by the TON blockchain\'s rapid transaction capabilities. There are no minimum withdrawal thresholds or restrictive payout schedules, putting authors firmly in control of their finances.\\n\\n\\n\\n### Addressing a Critical Gap in E-Commerce\\n\\nWhen asked about the motivation behind the platform, ETN Ecosystem Founder Jason Peters, widely known by his social media nickname JP, shared a powerful insight into the challenges faced by African entrepreneurs:\\n\\n\\"For as long as I can remember,\\" JP stated, \\"myself personally and almost everyone that I know has watched videos on YouTube about how to start making money onlinestartup Drop shipping, sell ebooks, sell DIY trinkets, and all kinds of things. And this has seemed like a pipe dream to most of us because being in Ethiopia, it\'s not as easy as the content creators in the videos make it out to be. They just sign up for a PayPal account or a Visa/MasterCard merchant account and integrate payment systems in 5 seconds and start making money online.\\"\\n\\nJP continued, \\"One of the big issues, hurdles, or whatever you want to call it, that we have as Africans is that nobody really recognizes the market potential that our continent presents to the e-commerce world. It\'s not that we don\'t have anything to offer the world, it\'s not like we don\'t want to sell anything, it\'s not like we don\'t have internet, but none of these service providers have even taken initiative to try and provide services to allow us to be active and engage in e-commerce easily like they do for the rest of the world. What most see as a standard thing is a huge luxury to all of us.\\"\\n\\n\\"This is the key principle and foundation that the ETN Ecosystem is built on,\\" he emphasized. \\"We\'re trying to provide solutions to problems specifically in the context of Africans being able to make money online without joining some pyramid or Ponzi scheme or some kind of a scam that doesn\'t rely on bringing in this amount of people and taking commission from their entry fee and that ends up being a big house of cards that all collapses in the end. This ebook platform launch is one out of 17 platforms, each addressing a problem or a niche issue that Ethiopians and Africans as a whole have in joining the e-commerce system that the world has been enjoying for more than a decade. We strive to create a new middle class by using Web3 and blockchain technology, empowering our people.\\"\\n\\n### Platform Availability and Vision\\n\\nMesewer Books will operate exclusively using ETN tokens for all transactions. Due to Apple\'s in-app purchase regulations and this token exclusivity, the Mesewer Books app will be available solely through the Telegram App Center for Android and PC users.\\n\\nThis launch marks a significant step in the ETN Ecosystem\'s broader mission to develop its planned platforms, each designed to tackle specific challenges and unlock economic opportunities for individuals across Ethiopia and the African continent. By harnessing the power of Web3 and blockchain, the ETN Ecosystem is committed to fostering a new era of financial empowerment and inclusion.\\n\\n### About ETN Ecosystem & ET Netsa Apps:\\n\\nThe ETN Ecosystem is a visionary initiative focused on leveraging Web3 and blockchain technologies to create accessible and equitable e-commerce solutions for Africa. ET Netsa Apps is the development arm responsible for building the diverse range of platforms within the ecosystem, starting with Mesewer Books."},{"id":"/2025/06/01/mesewer-books-launch","metadata":{"permalink":"/blog/2025/06/01/mesewer-books-launch","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-06-01-mesewer-books-launch.md","source":"@site/blog/2025-06-01-mesewer-books-launch.md","title":"Upcoming Launch of Mesewer Books- A Web3 Ebook Marketplace by the ETN Ecosystem, Championing African Authors and Revolutionizing E-Commerce Access","description":"FOR IMMEDIATE RELEASE","date":"2025-06-01T00:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":3.64,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"title":"Upcoming Launch of Mesewer Books- A Web3 Ebook Marketplace by the ETN Ecosystem, Championing African Authors and Revolutionizing E-Commerce Access","date":"2025-06-01T00:00:00.000Z","authors":["etn"],"tags":["etn"]},"unlisted":false,"prevItem":{"title":"ETN Ecosystem Launches Mesewer Books: A Web3 Ebook Marketplace","permalink":"/blog/etn-ecosystem-launches-mesewer-books"},"nextItem":{"title":"Strategic Enhancements: Authentication, Governance, and Platform Expansion in the ETN Ecosystem","permalink":"/blog/strategic-enhancements-authentication-governance-platform-expansion"}},"content":"FOR IMMEDIATE RELEASE\\n\\nADDIS ABABA, ETHIOPIA  June 1, 2025  ET Netsa Apps and Cryptotalk-ET, parent companies of the independently operated ETN Ecosystem (governed by the ETN Council and ETN Foundation), today announced the upcoming launch of Mesewer Books, a groundbreaking Web3 ebook marketplace. The launch is slated for late June 2025.\\n<!--truncate-->\\nMesewer Books, whose name is etymologically derived from the Amharic word \\"sineMesewer\\" ( ) meaning cryptography, is set to empower authors, particularly within Africa. The platform will offer an unprecedented 90% revenue share and leverage the efficiency of blockchain technology for instant payouts, exclusively through its native ETN token (ET Netsa Coin).\\n\\nThis innovative platform aims to dismantle the traditional barriers faced by African creators in the digital marketplace. Authors publishing on Mesewer Books will benefit from a transparent 10% commission structure, with immediate access to their earnings facilitated by the TON blockchain\'s rapid transaction capabilities. There are no minimum withdrawal thresholds or restrictive payout schedules, putting authors firmly in control of their finances.\\n\\n## Addressing a Critical Gap in E-Commerce\\n\\nWhen asked about the motivation behind the platform, ETN Ecosystem Founder Jason Peters, widely known by his social media nickname JP, shared a powerful insight into the challenges faced by African entrepreneurs:\\n\\n\\"For as long as I can remember,\\" JP stated, \\"myself personally and almost everyone that I know has watched videos on YouTube about how to start making money onlinestartup Drop shipping, sell ebooks, sell DIY trinkets, and all kinds of things. And this has seemed like a pipe dream to most of us because being in Ethiopia, it\'s not as easy as the content creators in the videos make it out to be. They just sign up for a PayPal account or a Visa/MasterCard merchant account and integrate payment systems in 5 seconds and start making money online.\\"\\n\\nJP continued, \\"One of the big issues, hurdles, or whatever you want to call it, that we have as Africans is that nobody really recognizes the market potential that our continent presents to the e-commerce world. It\'s not that we don\'t have anything to offer the world, it\'s not like we don\'t want to sell anything, it\'s not like we don\'t have internet, but none of these service providers have even taken initiative to try and provide services to allow us to be active and engage in e-commerce easily like they do for the rest of the world. What most see as a standard thing is a huge luxury to all of us.\\"\\n\\n\\"This is the key principle and foundation that the ETN Ecosystem is built on,\\" he emphasized. \\"We\'re trying to provide solutions to problems specifically in the context of Africans being able to make money online without joining some pyramid or Ponzi scheme or some kind of a scam that doesn\'t rely on bringing in this amount of people and taking commission from their entry fee and that ends up being a big house of cards that all collapses in the end. This ebook platform launch is one out of 17 platforms, each addressing a problem or a niche issue that Ethiopians and Africans as a whole have in joining the e-commerce system that the world has been enjoying for more than a decade. We strive to create a new middle class by using Web3 and blockchain technology, empowering our people.\\"\\n\\n## Platform Availability and Vision\\n\\nMesewer Books will operate exclusively using ETN tokens (ET Netsa Coin) for all transactions. Due to Apple\'s in-app purchase regulations and this token exclusivity, the Mesewer Books app will be available solely through the Telegram App Center for Android and PC users upon its launch in late June 2025.\\n\\nThis upcoming launch marks a significant step in the ETN Ecosystem\'s broader mission to develop 17 distinct platforms, each designed to tackle specific challenges and unlock economic opportunities for individuals across Ethiopia and the African continent. By harnessing the power of Web3 and blockchain, the ETN Ecosystem is committed to fostering a new era of financial empowerment and inclusion.\\n\\n## About ET Netsa Apps & the ETN Ecosystem:\\n\\nET Netsa Apps and Cryptotalk-ET are the parent companies overseeing the ETN Ecosystem. The ETN Ecosystem operates independently, guided by the ETN Council and ETN Foundation, with a vision to leverage Web3 and blockchain technologies for creating accessible and equitable e-commerce solutions for Africa."},{"id":"strategic-enhancements-authentication-governance-platform-expansion","metadata":{"permalink":"/blog/strategic-enhancements-authentication-governance-platform-expansion","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-05-15-strategic-enhancements-authentication-governance-platform-expansion.md","source":"@site/blog/2025-05-15-strategic-enhancements-authentication-governance-platform-expansion.md","title":"Strategic Enhancements: Authentication, Governance, and Platform Expansion in the ETN Ecosystem","description":"The ETN Ecosystem is excited to announce significant advancements that mark a new phase of maturation, reinforcing our commitment to robust security, active community engagement, and a clearly defined governance structure. These strategic updates strengthen our foundation for sustained growth and increased adoption, particularly within the burgeoning African digital landscape and the broader TON blockchain community.","date":"2025-05-15T10:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":3,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"strategic-enhancements-authentication-governance-platform-expansion","title":"Strategic Enhancements: Authentication, Governance, and Platform Expansion in the ETN Ecosystem","authors":["etn"],"tags":["etn"],"date":"2025-05-15T10:00:00.000Z"},"unlisted":false,"prevItem":{"title":"Upcoming Launch of Mesewer Books- A Web3 Ebook Marketplace by the ETN Ecosystem, Championing African Authors and Revolutionizing E-Commerce Access","permalink":"/blog/2025/06/01/mesewer-books-launch"},"nextItem":{"title":"Engage and Earn: Introducing the Ethiopian-Themed $ETN Airdrop Game!","permalink":"/blog/ethiopian-themed-airdrop-game"}},"content":"The ETN Ecosystem is excited to announce significant advancements that mark a new phase of maturation, reinforcing our commitment to robust security, active community engagement, and a clearly defined governance structure. These strategic updates strengthen our foundation for sustained growth and increased adoption, particularly within the burgeoning African digital landscape and the broader TON blockchain community.\\n\\n<!--truncate-->\\n\\n### Key Developments\\n\\n**1. Enhanced Security with ETN Authenticator:**\\nWe\'ve introduced the ETN Authenticator, a novel NFT-based two-factor authentication (2FA) system. This system leverages \\"ETN Numbers NFTs\\" and Wallet Connect to provide unified and secure access across all ETN Ecosystem platforms. By tying 2FA to unique, user-owned digital assets, we\'re moving beyond traditional methods to align authentication with Web3 principles of user sovereignty and control. This not only enhances security but also increases the utility and intrinsic value of holding ETN Numbers NFTs.\\n\\n**2. Exclusively NFT-Driven Governance:**\\nOur governance model has been refined to be exclusively driven by Non-Fungible Tokens (NFTs). This means that holding $ETN tokens alone no longer grants direct voting rights; instead, decision-making power is now entirely encapsulated and exercised through the ownership of specific governance NFTs. This strategic choice aims to tie influence more directly to specific forms of stake and commitment within the ecosystem. Our governance structure includes:\\n*   **SBTs (Soulbound Tokens):** 8 non-transferable SBTs held by the development team, each with 10 votes, ensuring core team stewardship.\\n*   **Council Minister NFTs:** 10 NFTs, available for 10 TON each, for active community leaders (5 or 10 votes each, clarification pending).\\n*   **Investor NFTs:** 2 NFTs, priced at 50 TON each, granting 10 votes each for significant stakeholders.\\n*   **$ETN Treasury Bonds:** 200 bonds, each granting 1 vote, functioning as verifiable tokenized assets for broader community participation.\\n\\n**3. Launch of Mesewer Books:**\\nWe are thrilled to announce Mesewer Books, a new platform within our expanding suite of services. While specific details are pending, Mesewer Books is set to diversify our offerings, potentially focusing on content distribution, digital publishing, or specialized record-keeping. This addition underscores our dynamic approach to adding new services that broaden the ecosystem\'s overall utility and appeal.\\n\\n**4. Commemorating \\"Ahadu Batch\\" with Ahadu Badge SBT:**\\nETN Learn, our educational arm, celebrated the graduation of its first cohort from the \\"Ultimate Netsa Summer Bootcamp.\\" To commemorate this milestone, we introduced the Ahadu Badge, a commemorative Soulbound Token (SBT) awarded to these graduates, designated the \\"Ahadu Batch\\" or \\"Genesis Block.\\" These 192 non-transferable SBTs grant lifetime access to all ETN Learn courses, including premium content, fostering loyalty and demonstrating the practical applications of SBT technology.\\n\\n### Synergies and Outlook\\n\\nThese new elements are designed to integrate seamlessly with existing platforms, creating a more cohesive, secure, and utilitarian environment. The ETN Authenticator provides a common security framework, Mesewer Books introduces a new content vertical, and ETN Learn cultivates a skilled user base. This holistic strategy aims to create a virtuous cycle of enhanced security, new value, and continuous education, driving adoption and economic activity across the entire ETN Ecosystem.\\n\\nOur roadmap for 2024-2027 continues to guide our development, with recent milestones like the GekoTerminal listing and ETN Ads alpha testing demonstrating our progress. We remain committed to securing funding and prioritizing long-term solutions, with a unique sustainability model that involves collecting platform fees in $ETN and distributing them annually to stakeholders, fostering sustainable growth and shared value creation.\\n\\nThe ETN Ecosystem is actively solidifying its core infrastructure and expanding its service offerings, tailored to address the needs and opportunities within the African market, with a strong emphasis on education, practical utility, and financial inclusion."},{"id":"ethiopian-themed-airdrop-game","metadata":{"permalink":"/blog/ethiopian-themed-airdrop-game","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-04-01-ethiopian-themed-airdrop-game.md","source":"@site/blog/2025-04-01-ethiopian-themed-airdrop-game.md","title":"Engage and Earn: Introducing the Ethiopian-Themed $ETN Airdrop Game!","description":"Get ready to play and earn! The ETN Ecosystem is thrilled to announce the launch of our new Ethiopian-themed $ETN Airdrop Game, designed to engage our vibrant community and distribute $ETN tokens in a fun, interactive way through Telegram Mini Apps.","date":"2025-04-01T10:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":0.85,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"ethiopian-themed-airdrop-game","title":"Engage and Earn: Introducing the Ethiopian-Themed $ETN Airdrop Game!","authors":["etn"],"tags":["etn"],"date":"2025-04-01T10:00:00.000Z"},"unlisted":false,"prevItem":{"title":"Strategic Enhancements: Authentication, Governance, and Platform Expansion in the ETN Ecosystem","permalink":"/blog/strategic-enhancements-authentication-governance-platform-expansion"},"nextItem":{"title":"Ahadu Batch Graduates, Ahadu Badge SBT Launched, and ETN Ecosystem Soft Launch!","permalink":"/blog/ahadu-batch-graduation-sbt-ecosystem-soft-launch"}},"content":"Get ready to play and earn! The ETN Ecosystem is thrilled to announce the launch of our new **Ethiopian-themed $ETN Airdrop Game**, designed to engage our vibrant community and distribute $ETN tokens in a fun, interactive way through Telegram Mini Apps.\\n\\n<!--truncate-->\\n\\nThis gamified airdrop is part of our updated tokenomics strategy, where 2,000,000 $ETN from the combined \\"Airdrop/Presale Wallet\\" are allocated for current and future distributions. We believe in fostering community growth and rewarding active participation, and this new game is a perfect embodiment of that commitment.\\n\\nThe game, accessible directly within Telegram, will feature elements inspired by Ethiopian culture and history, providing an immersive and enjoyable experience for all participants. It\'s an exciting opportunity for both new and existing community members to earn $ETN tokens and deepen their connection with the ETN Ecosystem.\\n\\nStay tuned for more details on how to participate, game mechanics, and reward structures. Get ready to dive into the world of gamified airdrops and be a part of the growing ETN community!"},{"id":"ahadu-batch-graduation-sbt-ecosystem-soft-launch","metadata":{"permalink":"/blog/ahadu-batch-graduation-sbt-ecosystem-soft-launch","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024/2024-11-17-ahadu-batch-graduation-sbt-ecosystem-soft-launch.md","source":"@site/blog/2024/2024-11-17-ahadu-batch-graduation-sbt-ecosystem-soft-launch.md","title":"Ahadu Batch Graduates, Ahadu Badge SBT Launched, and ETN Ecosystem Soft Launch!","description":"November 17, 2024, marked a monumental day for the ETN Ecosystem as we celebrated the graduation of the first cohort from the Ultimate Netsa Summer Bootcamp, proudly dubbed the \\"Ahadu Batch\\" (or \\"Genesis Block\\")! This event also served as the soft launch of the entire ETN Ecosystem, setting the stage for our ambitious goal to onboard 3050 million Ethiopians to the TON blockchain within five years.","date":"2024-11-17T10:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":1.58,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"ahadu-batch-graduation-sbt-ecosystem-soft-launch","title":"Ahadu Batch Graduates, Ahadu Badge SBT Launched, and ETN Ecosystem Soft Launch!","authors":["etn"],"tags":["etn"],"date":"2024-11-17T10:00:00.000Z"},"unlisted":false,"prevItem":{"title":"Engage and Earn: Introducing the Ethiopian-Themed $ETN Airdrop Game!","permalink":"/blog/ethiopian-themed-airdrop-game"},"nextItem":{"title":"ETN Ads Enters Closed Alpha Testing Phase","permalink":"/blog/etn-ads-alpha-testing"}},"content":"November 17, 2024, marked a monumental day for the ETN Ecosystem as we celebrated the graduation of the first cohort from the **Ultimate Netsa Summer Bootcamp**, proudly dubbed the \\"**Ahadu Batch**\\" (or \\"Genesis Block\\")! This event also served as the **soft launch of the entire ETN Ecosystem**, setting the stage for our ambitious goal to onboard 3050 million Ethiopians to the TON blockchain within five years.\\n\\n<!--truncate-->\\n\\nThe intensive two-month bootcamp, offered free of charge through ETN Learn, successfully equipped over 7,000 Ethiopian 12th-grade students with vital knowledge in Forex Trading, Cryptocurrency and Blockchain Technology, and an Introduction to Web3 and The Open Network (TON).\\n\\n### Introducing the Ahadu Badge SBT\\n\\nA highlight of the graduation ceremony was the introduction of the **Ahadu Badge**, a commemorative **Soulbound Token (SBT)** awarded to these pioneering graduates. A total of 192 Ahadu Badges were minted on the TON blockchain, each adorned with unique Ahadu Batch insignia. These non-transferable SBTs are more than just a symbol of achievement; they grant **lifetime access to all courses on the ETN Learn platform**, including premium paid content. This initiative exemplifies our sophisticated approach to community engagement and value delivery, fostering loyalty and demonstrating the practical utility of SBT technology.\\n\\nThe event was further bolstered by a partnership with Exness Limited, a global broker, whose East Africa Regional Head of Sales attended the ceremony. Top-performing students in the trading module were also awarded prizes, including a laptop, tablet, and smartphone.\\n\\nThis collective achievementthe successful graduation of our first batch of Web3-educated individuals, the innovative use of SBTs for credentials and utility, and the soft launch of our ecosystemcreates a powerful narrative of growth, empowerment, and immediate real-world application. We are building a direct pipeline of educated and engaged human capital that will contribute to the vitality, innovation, and overall growth of the entire ETN Ecosystem."},{"id":"etn-ads-alpha-testing","metadata":{"permalink":"/blog/etn-ads-alpha-testing","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024/2024-10-12-etn-ads-alpha-testing.md","source":"@site/blog/2024/2024-10-12-etn-ads-alpha-testing.md","title":"ETN Ads Enters Closed Alpha Testing Phase","description":"We are pleased to announce that ETN Ads has officially entered its closed alpha testing phase as of October 12, 2024! This marks a significant step forward for the platform, which was developed during a hackathon challenge by a dedicated community member.","date":"2024-10-12T10:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":0.84,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"etn-ads-alpha-testing","title":"ETN Ads Enters Closed Alpha Testing Phase","authors":["etn"],"tags":["etn"],"date":"2024-10-12T10:00:00.000Z"},"unlisted":false,"prevItem":{"title":"Ahadu Batch Graduates, Ahadu Badge SBT Launched, and ETN Ecosystem Soft Launch!","permalink":"/blog/ahadu-batch-graduation-sbt-ecosystem-soft-launch"},"nextItem":{"title":"A Community Gift to Pavel Durov: $ETN Tokens Sent on His Birthday","permalink":"/blog/community-gift-pavel-durov"}},"content":"We are pleased to announce that **ETN Ads** has officially entered its closed alpha testing phase as of October 12, 2024! This marks a significant step forward for the platform, which was developed during a hackathon challenge by a dedicated community member.\\n\\n<!--truncate-->\\n\\nETN Ads is designed to be an innovative advertising portal within the ETN Ecosystem, connecting content creators with potential advertisers and offering a new avenue for revenue generation, especially in regions with limited online payment gateways like Ethiopia.\\n\\nThe transition to closed alpha testing signifies that the core functionalities are in place and are now being rigorously tested by a select group of users. This phase is crucial for gathering valuable feedback, identifying any bugs, and refining the user experience before a broader release.\\n\\nThis milestone highlights our commitment to fostering community-driven product innovation and bringing practical, decentralized solutions to market. We look forward to the insights gained from this testing phase to make ETN Ads a robust and effective platform for all users."},{"id":"community-gift-pavel-durov","metadata":{"permalink":"/blog/community-gift-pavel-durov","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024/2024-10-10-community-gift-pavel-durov.md","source":"@site/blog/2024/2024-10-10-community-gift-pavel-durov.md","title":"A Community Gift to Pavel Durov: $ETN Tokens Sent on His Birthday","description":"On October 10, 2024, the ETN Ecosystem community came together to send a special birthday gift to Pavel Durov, the visionary founder of Telegram: a symbolic amount of $ETN tokens.","date":"2024-10-10T10:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":0.81,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"community-gift-pavel-durov","title":"A Community Gift to Pavel Durov: $ETN Tokens Sent on His Birthday","authors":["etn"],"tags":["etn"],"date":"2024-10-10T10:00:00.000Z"},"unlisted":false,"prevItem":{"title":"ETN Ads Enters Closed Alpha Testing Phase","permalink":"/blog/etn-ads-alpha-testing"},"nextItem":{"title":"$ETN Listed on GekoTerminal: Enhanced Visibility for the ETN Ecosystem","permalink":"/blog/etn-gekoterminal-listing"}},"content":"On October 10, 2024, the ETN Ecosystem community came together to send a special birthday gift to Pavel Durov, the visionary founder of Telegram: a symbolic amount of $ETN tokens.\\n\\n<!--truncate-->\\n\\nThis gesture was more than just a birthday wish; it was an expression of deep appreciation for the Telegram platform, which serves as a crucial backbone for the ETN Ecosystem and its vibrant community. Telegram\'s robust and accessible infrastructure has been instrumental in our growth and ability to connect with users across Africa and beyond.\\n\\nThe community\'s hope is that these $ETN tokens will be held by Pavel Durov until they gain significant value, potentially even enough to fund future Telegram server purchases. This highlights our belief in the long-term potential of $ETN and the symbiotic relationship between the ETN Ecosystem and the broader TON/Telegram network.\\n\\nThis initiative underscores the strong bond and shared vision between the ETN community and the foundational technologies that enable our decentralized solutions."},{"id":"etn-gekoterminal-listing","metadata":{"permalink":"/blog/etn-gekoterminal-listing","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024/2024-09-07-etn-gekoterminal-listing.md","source":"@site/blog/2024/2024-09-07-etn-gekoterminal-listing.md","title":"$ETN Listed on GekoTerminal: Enhanced Visibility for the ETN Ecosystem","description":"We are excited to announce a significant milestone for the ETN Ecosystem: the official listing of the $ETN token on GekoTerminal on September 7, 2024!","date":"2024-09-07T10:00:00.000Z","tags":[{"inline":false,"label":"ETN","permalink":"/blog/tags/tags/etn","description":"The official ETN token powering the ETN Ecosystem on the TON blockchain."}],"readingTime":0.72,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"etn-gekoterminal-listing","title":"$ETN Listed on GekoTerminal: Enhanced Visibility for the ETN Ecosystem","authors":["etn"],"tags":["etn"],"date":"2024-09-07T10:00:00.000Z"},"unlisted":false,"prevItem":{"title":"A Community Gift to Pavel Durov: $ETN Tokens Sent on His Birthday","permalink":"/blog/community-gift-pavel-durov"},"nextItem":{"title":"ETN Learn Launches Ultimate Netsa Summer Bootcamp","permalink":"/blog/ultimate-netsa-bootcamp-launch"}},"content":"We are excited to announce a significant milestone for the ETN Ecosystem: the official listing of the $ETN token on **GekoTerminal** on September 7, 2024!\\n\\n<!--truncate-->\\n\\nThis listing marks a crucial step in increasing the visibility and accessibility of $ETN to a broader audience of traders and investors. GekoTerminal is a well-regarded crypto-tracking platform, and its inclusion of $ETN will provide enhanced data, charts, and market insights for our community and potential new holders.\\n\\nThis achievement reflects the growing recognition of the ETN Ecosystem\'s real-world utility and our commitment to building a robust and transparent decentralized economy. We believe this listing will contribute to greater liquidity and foster wider adoption of the $ETN token as we continue to expand our suite of platforms and services.\\n\\nStay tuned for more updates as we continue to build and grow the ETN Ecosystem!"},{"id":"ultimate-netsa-bootcamp-launch","metadata":{"permalink":"/blog/ultimate-netsa-bootcamp-launch","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024/2024-07-30-ultimate-netsa-bootcamp-launch.md","source":"@site/blog/2024/2024-07-30-ultimate-netsa-bootcamp-launch.md","title":"ETN Learn Launches Ultimate Netsa Summer Bootcamp","description":"The ETN Ecosystem is proud to announce the launch of the Ultimate Netsa Summer Bootcamp through its educational arm, ETN Learn. Kicking off on July 30, 2024, this intensive two-month program is designed to empower the next generation of African innovators with essential Web3 knowledge.","date":"2024-07-30T10:00:00.000Z","tags":[{"inline":true,"label":"etn_learn","permalink":"/blog/tags/etn-learn"},{"inline":false,"label":"Web3","permalink":"/blog/tags/tags/web3","description":"Web3 technologies, integrations, and dApps within the ETN Ecosystem."}],"readingTime":0.83,"hasTruncateMarker":true,"authors":[{"name":"ETN Ecosystem","title":"ETN Team","url":"https://etn-ecosystem.com","page":{"permalink":"/blog/authors/all-etn-articles"},"socials":{"x":"https://x.com/etnetsa","linkedin":"https://www.linkedin.com/in/etn-ecosystem/","github":"https://github.com/ETN-Ecosystem"},"imageURL":"https://github.com/ETN-Ecosystem.png","key":"etn"}],"frontMatter":{"slug":"ultimate-netsa-bootcamp-launch","title":"ETN Learn Launches Ultimate Netsa Summer Bootcamp","authors":["etn"],"tags":["etn_learn","web3"],"date":"2024-07-30T10:00:00.000Z"},"unlisted":false,"prevItem":{"title":"$ETN Listed on GekoTerminal: Enhanced Visibility for the ETN Ecosystem","permalink":"/blog/etn-gekoterminal-listing"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"The ETN Ecosystem is proud to announce the launch of the **Ultimate Netsa Summer Bootcamp** through its educational arm, ETN Learn. Kicking off on July 30, 2024, this intensive two-month program is designed to empower the next generation of African innovators with essential Web3 knowledge.\\n\\n<!--truncate-->\\n\\nOffered completely free of charge, the bootcamp attracted over 7,000 Ethiopian 12th-grade students. Participants are immersed in critical topics including:\\n*   Forex Trading\\n*   Cryptocurrency and Blockchain Technology\\n*   Introduction to Web3 and The Open Network (TON)\\n\\nThis initiative is a cornerstone of our mission to foster digital literacy and financial inclusion across Africa. By providing accessible, high-quality education, we aim to equip individuals with the skills needed to thrive in the decentralized economy. The bootcamp culminates in a graduation ceremony where top-performing students are recognized and awarded.\\n\\nThe Ultimate Netsa Summer Bootcamp is a testament to ETN Ecosystem\'s commitment to building a knowledgeable and engaged community, laying the groundwork for widespread adoption of blockchain technology in the region."},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2021-08-26-welcome/index.md","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","tags":[{"inline":true,"label":"facebook","permalink":"/blog/tags/facebook"},{"inline":true,"label":"hello","permalink":"/blog/tags/hello"},{"inline":true,"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.56,"hasTruncateMarker":true,"authors":[{"name":"Yangshun Tay","title":"Ex-Meta Staff Engineer, Co-founder GreatFrontEnd","url":"https://linkedin.com/in/yangshun","page":{"permalink":"/blog/authors/yangshun"},"socials":{"x":"https://x.com/yangshunz","linkedin":"https://www.linkedin.com/in/yangshun/","github":"https://github.com/yangshun","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/yangshun.png","key":"yangshun"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["yangshun"],"tags":["facebook","hello","docusaurus"]},"unlisted":false,"prevItem":{"title":"ETN Learn Launches Ultimate Netsa Summer Bootcamp","permalink":"/blog/ultimate-netsa-bootcamp-launch"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nHere are a few tips you might find useful.\\n\\n<!-- truncate -->\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."}]}}');

